import styled from "styled-components";

function SideMenu({ menuClose }) {
  return (
    <Mbtn onClick={menuClose}>
      <Wrap>
        <a href="#">
          <span>
            <Line01></Line01>
            <Line02></Line02>
            <Line03></Line03>
          </span>
        </a>
        <ul>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./index.php" class="mainBtn_m">
                ABOUT
              </a>
              <span></span>
            </div>
          </li>
          <li class="addNav_m nav_m1">
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/design_uiux.php" class="mainBtn_m">
                SKILLS
              </a>
              <span></span>
            </div>
          </li>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/develop.php" class="mainBtn_m">
                DEVELOP
              </a>
              <span></span>
            </div>
          </li>
          <li>
            <Num>01</Num>
            <div class="txtWrap">
              <a href="./sub/about.php" class="mainBtn_m">
                PROJECT
              </a>
              <span></span>
            </div>
          </li>
        </ul>
      </Wrap>
    </Mbtn>
  );
}

const Mbtn = styled.div`
  z-index: 5;
  display: block;
  position: fixed;
  top: 0;
  left: 50%;
  background: #0c1017;
  width: 100%;
  height: 100%;
  transition: all 0.3s;
  overflow: hidden;
`;

const Wrap = styled.div`
  li {
    width: 100%;
    display: flex;
    justify-content: space-around;
  }
`;

const Line01 = styled.i`
  top: 50%;
  margin-top: -1px;
  transform: rotate(135deg);
`;

const Line02 = styled.i`
  left: -100%;
`;

const Line03 = styled.i`
  bottom: 50%;
  margin-bottom: -1px;
  transform: rotate(-135deg);
`;

const Num = styled.div`
  bottom: 7px;
  font-size: 17px;
`;

export default SideMenu;
